window.bookSummaryJSON = "<p>As a cartography student, Jak has always dreamed of finding the lost dragon gate and exploring and mapping distant worlds.</p> <p>Developing magical powers and becoming a powerful wizard? Not a chance.</p> <p>Wizards are cruel and inhumane, warring with each other from their great sky cities and keeping most of humanity enslaved. Jak wants nothing to do with them.</p> <p>But when he and his archaeologist mother unearth the gate, they attract the attention of the very wizards they sought to avoid. Even more troubling, Jak starts developing magical powers of his own, powers that could rival those of the great rulers.</p> <p>Fate may have given him the opportunity to change the world.</p> <p>But the wizard rulers don’t like change, and when they detect threats, they send their elite assassins to eliminate them.</p> <p>If Jak can’t unlock the power of the gate, and the powers within himself, the world will remain enslaved forever.</p>"; 
